import React from "react";
import notes from "../notes";

function Note() {
  return (
  <div className="note">
    <h1>This is the note title</h1>
    <p>This is the note content</p>
    {notes.map(oneNote => {
      return(oneNote.title );
    })}
  </div>);
}

export default Note;
